/*Table structure for table `auto_test_record` */

DROP TABLE IF EXISTS `auto_test_record`;

CREATE TABLE `auto_test_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `job_name` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '任务名称 P0 P1 P2为case级别',
  `build_no` int(32) NOT NULL,
  `total_executed` int(11) NOT NULL DEFAULT '0' COMMENT 'case总数',
  `success_count` int(11) DEFAULT '0' COMMENT '通过数',
  `error_count` int(11) DEFAULT '0' COMMENT '异常数',
  `failure_count` int(11) DEFAULT '0' COMMENT '失败数',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '运行状态:0-失败,1-运行中,2-已结束,3-手动终止',
  `start_time` datetime DEFAULT NULL COMMENT '开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '结束时间',
  `report_url` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '测试报告链接',
  `fail_info` text COLLATE utf8_unicode_ci COMMENT 'case失败详细信息',
  `error_info` text COLLATE utf8_unicode_ci COMMENT 'case错误详细信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=55 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='接口自动化测试记录表';

