/*Table structure for table `common_config` */

DROP TABLE IF EXISTS `common_config`;

CREATE TABLE `common_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '配置名称',
  `value` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '配置值',
  `comment` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '配置说明',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL COMMENT '更新时间',
  `operate_ip` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '操作人电脑IP',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='通用配置表';

