/*Table structure for table `load_test_record` */

DROP TABLE IF EXISTS `load_test_record`;

CREATE TABLE `load_test_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_count` int(11) NOT NULL DEFAULT '0' COMMENT '压测总用户数',
  `hatch_rate` int(11) DEFAULT '0' COMMENT '每秒启动用户数',
  `total_rps` float NOT NULL DEFAULT '0' COMMENT 'RPS',
  `fail_ratio` float DEFAULT '0' COMMENT '失败率',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '压测状态:0-未运行,1-运行中,2-已结束',
  `start_time` datetime DEFAULT NULL COMMENT '压测开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '压测结束时间',
  `stats` text COLLATE utf8_unicode_ci,
  `exceptions` text COLLATE utf8_unicode_ci,
  `data_struct` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '测试数据构成信息',
  `scene_struct` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '测试场景构成信息',
  PRIMARY KEY (`id`)
