/*Table structure for table `svc_load_client` */

DROP TABLE IF EXISTS `svc_load_client`;

CREATE TABLE `svc_load_client` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `client_ip` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '服务器IP',
  `role` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '服务器角色1:master 2:slave',
  `status` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '机器状态 1:可用 0:禁用',
  `slave_count` int(10) NOT NULL DEFAULT '4' COMMENT '每个压测机默认启用的压测节点数',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL,
  `operate_ip` varchar(255) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT '操作人电脑IP',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=116 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='svc压测机器管理表';

