  `id` int(11) NOT NULL AUTO_INCREMENT,
  `server_ip` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '服务器IP',
  `owner` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '-' COMMENT '服务器所有者',
  `usage` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '-' COMMENT '服务器用途',
  `server_type` int(10) NOT NULL DEFAULT '4' COMMENT '机器类型：1-虚拟机 2-物理机',
  `cpu` varchar(32) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT 'cpu核数',
  `memory` varchar(32) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT '内存total',
  `disk` varchar(32) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT '硬盘total',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='测试组服务器管理表';

